import React from "react";
import {Link} from "react-router-dom";

function Navigator(){
    // home('/')으로 이동시, 인증에따라 로그인 됬을경우, 아닐경우로 렌더링 다르게 해야함 
    return (
        <div className="nav">
            <Link to="/">Home</Link> 
            <Link to="/recentWork">RecentWork</Link>
        </div>
    ); 
}
